import './App.css';
import React, { useState } from 'react';
import ButtonComponent from './components/ButtonComponent';

function clicked(name){
  alert(`button clicked by ${name}`);
}
function App() {
  let title = 'Welcome Guest';
  const [label, setLabel] = useState('Register')

  const change=()=>{
    alert('hello');
    //title='hey';
    setLabel('Clear');
    // console.log(title);
  };

  let customers =[
    {
      id:1,
      name:'Shalini'
    },
    {
      id:2,
      name:'Shreya'
    },
  ]

  return (
    <React.Fragment>
    <h1>{title}</h1>
    <p>akfhad</p>
    <ButtonComponent label={'Submit'}/>
    <ButtonComponent label={label} change={change}/>
    {/* <button onClick={()=>clicked('Shalini')}>Click Me</button> */}
    Customers: {JSON.stringify(customers) && <p>No customers yet</p>}
    Customers: {customers.length==0 ? <p>No customers yet!!</p>: customers}
    </React.Fragment>
      );
}

export default App;
